import React from "react";
import "../styles/Header.css";
import Logo from "../images/myname.jpg";

// import Navigation from "./Navigation";

const styles = {
  img: {
    width: 100,
    height: 50,
  },
};

const Header = () => (
  <div class="header">
    <p className="b">This is a header</p>
    <img style={styles.img} src={Logo} alt="my name logo" />
  </div>
);

export default Header;
